INSERT INTO `jo_terms` (`jo_terms_id`, `jo_id`, `terms`, `revision_no`) VALUES
(1, 10, 'IMPORTANT REMINDERS:\nA. SUPPLIER ACKNOWLEDGMENT REQUIRED\nB. Delivery Instructions:\n1. P.O. No. must appear on all copies of Invoices, Delivery Receipts & Correspondences submitted.\n2. Copy of Approved PO with supplier''s/contractor''s CONFORME must be attached on Delivery Receipts, MIRR & Invoices.\n3. Destination: CDPP NPC Compound Sta. Isabel, Calapan City, Oriental Mindoro\nC. NO PAYMENT will be processed for failure to comply with the above mentioned instructions.', 0),
(2, 11, 'IMPORTANT REMINDERS:\nA. SUPPLIER ACKNOWLEDGMENT REQUIRED\nB. Delivery instructions:\n1. PO No. must appear on all copies of Invoices, Delivery Receipts & Correspondences\n2. Copy of approved PO with supplier''s/contractor''s CONFORME must be attached on Delivery Receipts, MIRR & Invoices.\n3. Destination: CDPP, NPC Compound Sta. Isabel, Calapan City, Oriental Mindoro\nC. NO PAYMENT will be processed for failure to comply with the above mentioned instructions.', 0),
(3, 19, 'Cash Purchase', 0),
(4, 32, 'terms of payment: CASH AFTER COMPLETION\nworking day/s: 1 day', 4),
(5, 33, 'Terms of Payment: cash after completion\nWorking day/s : 2-3 days', 5),
(6, 39, 'Cash for pick up', 0),
(7, 54, 'terms of payment:  30 days pdc', 1),
(8, 54, '', 1),
(9, 67, 'Terms of payment: 30 days PDC', 4),
(10, 77, 'payment terms: 30 days', 1),
(11, 79, '30 DAYS PAYMENT TERMS', 0),
(12, 80, 'Terms and Conditions:\nAny additional materials to be used that is not stated on the Purchase Order should be quote separately.(considering the actual dimension during works)\nWarranty: 1 year warranty\nTerms: 20% upon issuance of purchase order,20% upon submission of final drawing ,50% upon completion-PDC 30 days,10%retention-30 days from completion PDC\nDuration of works: 2 months\n\nOther terms and conditions:\n1. Upon receipt of purchase/job order -supplier to submit complete design with complete specifications of equipment included in the package.\nSubmission time- 2 weeks from receipt of order. This will be subject to review and approval of purchaser.\n2. 1-2 weeks to review and approve design submitted\n3. Immediately after approval of design, supplier to provide final design.\n4. Commencement of work\nAs additional requirement contractor to provide drawing for the proposed installation, Gann chart and detailed activities on commissioning and installation\n', 10),
(13, 81, 'PAYMENT TERMS: 50% DP, BALANCE UPON COMPLETION\nDURATION : 4-6 WORKING DAYS', 0),
(14, 82, 'PAYMENT TERMS: DATED CHECK UPON PICK UP AT IHI SHOP\nLEAD TIME: 1-2 DAYS\n\n', 2),
